<!doctype html>
<html lang="en">
<head>
  <meta charset="utf-8">
  <title>AI - Webex Design</title>
  <!-- Google tag (gtag.js) -->
  <link rel="stylesheet" href="/src.9ad09f98.css" type="text/css" media="all">
  <meta name="viewport" content="width=device-width, initial-scale=1, user-scalable=no">
<script src="/src.9ad09f98.js"></script></head>
<body class="desktop">
    <div id="loading">
      <h1 id="h1_loading">Select a model folder</h1>
      <input type="file" id="ipt_files" webkitdirectory="" multiple="">
    </div>
    <div class="desktop_main">
      <div class="client">
        <div class="video_con">
          <video id="video" autoplay=""></video>
          <canvas style="display: none;" class="c_v" id="canvas_hide"></canvas>
          <canvas class="c_v" id="canvas_background"></canvas>
          <canvas class="c_v" id="canvas_person"></canvas>
          <div id="panel" class="panel">
            <h2>Camera</h2>
            <div class="panel_video_bar">System Camera</div>
            <h1>AI Effect</h1>
            <div class="panel_items">
              <img class="item item_selected" data-type="0" src="/style0.80f5bad2.jpg">
              <img class="item" data-type="1" src="/style1.4035fef6.jpg">
              <img class="item" data-type="2" src="/style2.91793fe1.jpg">
              <img class="item" data-type="2" src="/style3.cf9f6d9b.jpg">
              <img class="item" data-type="2" src="/style4.7e0a5f01.jpg">
              <img class="item" data-type="2" src="/style5.88a477ce.jpg">
            </div>
            <h1>Background Image</h1>
            <div class="panel_items">
              <img class="item" data-type="3" src="/bg0.ebd82cc1.jpg">
              <img class="item" data-type="3" src="/bg1.d8730581.jpg">
              <img class="item" data-type="3" src="/bg2.c5812813.jpg">
              <img class="item" data-type="3" src="/bg3.cbaef0c4.jpg">
              <img class="item" data-type="3" src="/bg4.387bf0d2.jpg">
              <img class="item" data-type="3" src="/bg5.66fbac03.jpg">
              <img class="item" data-type="3" src="/bg6.f6c26d06.jpg">
            </div>
          </div>
        </div>
        <a class="video_button" id="video_button"><span id="video_button_text">Start video</span><span id="video_button_menu" class="menu_button"><i></i></span></a>
      </div>
    </div>
    <div class="task_bar">
      <div class="task_bar_left"></div>
    </div>
    <script src="/src.77de5100.js"></script>
</body>
</html>
